import morgan from 'morgan';

// Importing routes
import staffRoutes from './routes/staff';
import departmentRoutes from  './routes/department';


// initialozation
const app = express();

// middlewares
app.use(morgan('dev'));
app.use(json());

// routes
app.use('/api/staff', staffRoutes);
app.use('/api/department', departmentRoutes);

export default app;

