    staffID: {
        type: Sequelize.INTEGER,
        primaryKey: true,
        autoIncrement: true
    },
    name: {
        type: Sequelize.TEXT
    },
    career: {
        type: Sequelize.TEXT
    },
    semester: {
        type: Sequelize.TEXT
